import React from "react";



const Home = () => {

    return(
        <>
        <h4>Welcome to the Kalamazoo College COMP484/490 wildfire 
        visualization project!</h4>

        <div class="bodyDiv"><p>
        This web page is made for the Kalamazoo College COMP484/490 senior seminar course. 
        This project seeks to present educational resources related to historical wildfires 
        in the United States, combining informational text with an interactive map.  
        </p></div>

        <iframe src="https://www.drought.gov/historical-information?dataset=0&selectedDateUSDM=20111129&embedded=true" 
        name="Drought.gov Historical Information" scrolling="Yes" height="auto" width="100%"></iframe>
        </>
    )

}

export default Home;
